import React from 'react'
import {Routes, Route} from 'react-router-dom'
import Home from './pages/Home/Home'
import Auth from './pages/Auth/Auth'
function AllRoutes() {
  return (
    
        <Routes>
              <Route exact path='/' component={Home} />
        </Routes>
            
        
        
  )
}

export default AllRoutes
